import React from "react";
import FeedBackItem from "./FeedBackItem";

const FeedbackList = ({ feedback , handleDelete }) => {

  // let content = 'No Feedbacks. Do u wish to send a feedback?';
  // if(!feedback) {
  //   content = {content}
  // }
  return (
    <>
  {feedback && <ul style={{ listStyle: "none" }}>
        {feedback.map((item) => (
   <FeedBackItem 
          key={item.id} 
        //   rating={item.rating} 
        //   text={item.text} 
         item = {item}
         handleDelete = {handleDelete}
          />
        ))}
      </ul>  }    
      {!feedback && <p>No feedback yet</p>}
    
{/* <div>
  {content}
</div> */}
    </>
  );
};

export default FeedbackList;
